import React from 'react'

const Header = (props) => {
  console.log(props)
  return <h1>{props.course}</h1>
}
const Content = (parts) => {
  return (
    <div>
      <p>parts[0].name</p>
      <p>parts[1].name</p>
      <p>parts[2].name</p>
    </div>
  )
}
const Total = (parts) => {
  const total =
    parts[0].exercises +
    parts[1].exercises +
    parts[2].exercises
  return (
      <div>
        <p>
          total
        </p>
      </div>
    )
}
const App = () => {
  const course = {
    name: 'Half Stack application development',
    parts: [
      {
        name: 'Fundamentals of React',
        exercises: 10
      },
      {
        name: 'Using props to pass data',
        exercises: 7
      },
      {
        name: 'State of a component',
        exercises: 14
      }
    ]
  }
  return (
    <div>
      <Header course={course} />
      <Content parts={course}/>
      <Total parts={course} />
    </div>
  )
}

export default App
